module.exports = function() {
	process.stdout = process.stdout || {
		write: function(a, b, c) {
			console.log(a, b, c);
		}
	}
	if(Array.prototype.has === undefined) {
		Array.prototype.has = function(value) {
			return this.indexOf(value) !== -1;
		}
	}
	if(Array.prototype.removeIfHas === undefined) {
		Array.prototype.removeIfHas = function(value) {
			var index = this.indexOf(value);
			if(index !== -1) {
				return this.splice(index, 1);
			}
		}
	}
	if(Array.prototype.pushIfHasNot === undefined) {
		Array.prototype.pushIfHasNot = function(value) {
			if(this.indexOf(value) === -1) {
				this.push(value);
			}
		}
	}

}
